{"result":"@-moz-document url-prefix("http://127.0.0.1:8000/admin/"),
 url-prefix("http://localhost:8000/admin/") {
html[data-theme="light"],
:root {
    --primary: #443a59;
    --secondary: #625682;
    --accent: #ffffff;
    --primary-fg: #bcb4d7;

    --body-fg: #bcb4d7;
    --body-bg: #221c2d;
    --body-quiet-color: #fff;
    --body-loud-color: #000;

    --header-color: #fff;
    --header-branding-color: var(
    --accent);
    --header-bg: var(
    --secondary);
    --header-link-color: var(
    --primary-fg);

    --breadcrumbs-fg: #bcb4d7;
    --breadcrumbs-link-fg: var(
    --body-bg);
    --breadcrumbs-bg: var(
    --primary);

    --link-fg: #bcb4d7;
    --link-hover-color: rgb(255, 255, 255);
    --link-selected-fg: #5b80b2;

    --hairline-color: #e8e8e8;
    --border-color: #ccc;

    --error-fg: #ba2121;

    --message-success-bg: #dfd;
    --message-warning-bg: #ffc;
    --message-error-bg: #ffefef;

    --darkened-bg: #625682;
    --selected-bg: #ffffff;
    --selected-row: #fffff;

    --button-fg: #fff;
    --button-bg: var(
    --primary);
    --button-hover-bg: #609ab6;
    --default-button-bg: var(
    --secondary);
    --default-button-hover-bg: #205067;
    --close-button-bg: #625682;
    --close-button-hover-bg: #443a59;
    --delete-button-bg: #ba2121;
    --delete-button-hover-bg: #a41515;
  
    --font-family-primary: OCR A Std, monospace;
}}"}
